import React from 'react';

function LandingPage() {
    return (
        <div className="landing-page">
            <h1>Welcome to Our Kendo Club</h1>
            <p>Join our community to learn and practice the art of Kendo.</p>
        </div>
    );
}

export default LandingPage;
